import Link from 'next/link';

function MovieInfoLink({ id, src }) {
    return (
      <div>
        <Link href="/movieInfo/[id]">
          <a>
            <img src={src} style={{ height: '310px', verticalAlign: 'top' }} />
          </a>
        </Link>
      </div>
    )
};

export default MovieInfoLink;
